import React from 'react';
import Navbar from './Navbar';

const Hero = () => {
  return (
    <header className='h-screen'>
      <Navbar />
      <div className="content relative">
        <img src="Images\img12.jpg" className='w-screen h-screen object-cover' alt="" />
        <div className="text absolute top">
          <h1 className='font-Handwrite'>Welcome To Rosebud</h1>
        </div>
      </div>
    </header>
  )
}

export default Hero
